import React from 'react';

function App() {
  return (
    <div className="min-h-screen bg-black text-white flex items-center justify-center">
      <div className="text-center">
        <h1 className="text-4xl font-bold mb-4">SpiritLink OS</h1>
        <p className="text-gray-400">Consciousness Evolution Platform</p>
        <p className="text-sm text-gray-500 mt-4">Loading components...</p>
      </div>
    </div>
  );
}

export default App;
